import {
  ConversionRate,
  Currency,
  PortfolioV2,
} from '@luma-fe-workspace/redux';
import { ColDef } from 'ag-grid-community';
import { colors } from '@luma-fe-workspace/design-system';

type PortfolioSum = {
  count: number;
  notionalSum: number;
};

type PortfolioSums = {
  growth: PortfolioSum;
  income: PortfolioSum;
  'growth & income': PortfolioSum;
  digital: PortfolioSum;
};

type CurrencyMap = {
  [key: string]: { [key: string]: ConversionRate };
};

export const portfolioDefault: PortfolioSums = {
  growth: { count: 0, notionalSum: 0 },
  income: { count: 0, notionalSum: 0 },
  'growth & income': { count: 0, notionalSum: 0 },
  digital: { count: 0, notionalSum: 0 },
};

export enum StructuredProductsTypes {
  ReturnType = 'Return Type',
  Issuer = 'Issuer',
}

export type StructuredProductsType =
  | StructuredProductsTypes.ReturnType
  | StructuredProductsTypes.Issuer;

export const returnTypeTableColumnData: ColDef[] = [
  {
    field: 'Return Type',
    cellStyle: (params) => {
      if (params.rowIndex === 0) {
        return {
          borderLeft: `0.5rem ${colors.primary80Daintree} solid`,
        };
      }
      if (params.rowIndex === 1) {
        return {
          borderLeft: `0.5rem ${colors.primary60} solid`,
        };
      }
      if (params.rowIndex === 2) {
        return {
          borderLeft: `0.5rem ${colors.primary40} solid`,
        };
      }
      if (params.rowIndex === 3) {
        return {
          borderLeft: `0.5rem ${colors.primary20} solid`,
        };
      }
      if (params.rowIndex === 4) {
        return {
          borderLeft: `0.5rem ${colors.primary10} solid`,
        };
      }
      return;
    },
  },
  {
    field: 'Orders',
    cellStyle: { justifyContent: 'flex-end' },
    headerClass: 'ag-right-aligned-header',
  },
  {
    field: 'Notional',
    cellStyle: { justifyContent: 'flex-end' },
    headerClass: 'ag-right-aligned-header',
  },
];

export const currencySymbols: Record<string, string> = {
  USD: '$',
  EUR: '€',
  GBP: '£',
  CHF: 'CHF',
  SEK: 'SEK',
  NOK: 'NOK',
};

const savedCurrency = localStorage.getItem('selectedCurrency');
export const currency = savedCurrency
  ? {
      display: `${currencySymbols[savedCurrency]} (${savedCurrency})`,
      value: savedCurrency,
    }
  : { display: `${currencySymbols['USD']} (USD)`, value: 'USD' };

export const getConversionRate = (
  productCurrency: string,
  selectedCurrency: string,
  conversionData: CurrencyMap
): number => {
  if (productCurrency === selectedCurrency) {
    return 1;
  }
  const data = conversionData[productCurrency];

  if (data) {
    const value = data[selectedCurrency];
    if (value) return value.rate;
  }

  return 1;
};

export const notional = (
  data: PortfolioV2[],
  selectedCurrency: string,
  currencyConversionData: Currency[]
): PortfolioSums => {
  const { portfolioProducts } = data[0];

  if (!portfolioProducts) {
    return portfolioDefault;
  }

  const currencyConversionMap: CurrencyMap = currencyConversionData.reduce(
    (acc, cur) => {
      if (cur.conversionRates) {
        acc[cur.isoCode] = cur.conversionRates;
      }

      return acc;
    },
    {} as CurrencyMap
  );

  return portfolioProducts.reduce((acc, cur) => {
    const { currency } = cur;
    const conversionRate = getConversionRate(
      currency || '',
      selectedCurrency,
      currencyConversionMap
    );

    const growthSum = cur.orders?.reduce((preVal, currVal) => {
      if (currVal.quantity) {
        return preVal + currVal?.quantity;
      }
      return preVal;
    }, 0);

    const notionalSum = growthSum ? growthSum * conversionRate : 0;
    const count = cur.orders?.length || 0;

    if (cur.returnType === 'Growth') {
      const totalGrowthCount = acc.growth.count + count;
      const totalGrowthNotional = acc.growth.notionalSum + notionalSum;
      return {
        ...acc,
        growth: { count: totalGrowthCount, notionalSum: totalGrowthNotional },
      };
    }

    if (cur.returnType === 'Income') {
      const totalIncomeCount = acc.income.count + count;
      const totalIncomeNotional = acc.income.notionalSum + notionalSum;
      return {
        ...acc,
        income: { count: totalIncomeCount, notionalSum: totalIncomeNotional },
      };
    }

    if (cur.returnType === 'Growth & Income') {
      const totalGAndICount = acc['growth & income'].count + count;
      const totalGAndINotional =
        acc['growth & income'].notionalSum + notionalSum;
      return {
        ...acc,
        'growth & income': {
          count: totalGAndICount,
          notionalSum: totalGAndINotional,
        },
      };
    }

    if (cur.returnType === 'Digital') {
      const totalDigitalCount = acc.digital.count + count;
      const totalDigitalNotional = acc.digital.notionalSum + notionalSum;
      return {
        ...acc,
        digital: {
          count: totalDigitalCount,
          notionalSum: totalDigitalNotional,
        },
      };
    }
    return acc;
  }, portfolioDefault);
};

